vactory_migrate_plugin.add:
  path: '/admin/config/system/migrate-plugin/add'
  defaults:
    _title: 'Add new migration plugin'
    _form: 'Drupal\vactory_migrate_plugin\Form\VactoryMigratePluginForm'
  requirements:
    _permission: 'administer vactory_migrate_plugin configuration'
vactory_migrate_plugin.edit:
  path: '/admin/config/system/migrate-plugin/edit'
  defaults:
    _title: 'Edit existing migration Plugin'
    _form: 'Drupal\vactory_migrate_plugin\Form\VactoryMigratePluginForm'
  requirements:
    _permission: 'administer vactory_migrate_plugin configuration'
